// src/components/Header.js
import React from 'react';
import SteamLogo from './SteamLogo';
import '../css/Header.css'; // 필요한 CSS 파일을 import 합니다.

const Header = () => {
  return (
    <header className="header">
      <SteamLogo />
      <h1>나의 게임 사이트</h1>
      <nav>
        <ul className="categories">
          <li><a href="/home">액션</a></li>
          <li><a href="/games">공포</a></li>
          <li><a href="/about">퍼즐</a></li>
          <li><a href="contact">RPG</a></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
